/* eslint-disable jsx-a11y/anchor-is-valid */
import React from "react";
import { useParams } from 'react-router-dom';
import { AuthService } from './AuthService';
import { useEffect } from 'react';


function Header(){

  const userData = AuthService.getUserData();
  const isLoggedIn = AuthService.isLoggedIn();

  useEffect(() => {
    if (!isLoggedIn) {
      // Redirect to login if user is not logged in
      window.location.href = '/login';
    }
  }, [isLoggedIn]);

 const {id}=useParams();

    return(
        
          
        <div >
                
          <div class="sidebar">
            <div class="admin-info">
              <img src="http://localhost:6060/images/man.jpg" alt="Admin Logo"/>
              <p >Sathsara</p>
              <hr/>
            </div>
            <ul>
              <li><a href="/ho">Home</a></li>
              <li class="dropdown">
                <a href="#" class="dropdown-toggle">Vehicles</a>
                <div class="dropdown-content">
                  <a href="/all">All Vehicles</a>
                  <a href="/add">Add Vehicle</a>
                  
                </div>
              </li>
              <li class="dropdown">
                <a href="#" class="dropdown-toggle">Users</a>
                <div class="dropdown-content">
                  <a href="#">All Users</a>
                  <a href="add_user.html">Add User</a>
                
                </div>
              </li>
              <li><a href="orders.html">Bookings</a></li>
              <li><a href="settings.html">Settings</a></li>
            </ul>
          </div>

          <div class="content1">
            
  

          </div>
        </div>
 
        
    )
}

export default Header;
